    fun convertTo24Hour(timeString: String): String {
        val formatter12Hour = DateTimeFormatter.ofPattern("hh:mm a") // 12-hour format with AM/PM
        val formatter24Hour = DateTimeFormatter.ofPattern("HH:mm")  // 24-hour format
        val localTime = LocalTime.parse(timeString, formatter12Hour)
        return localTime.format(formatter24Hour)
    }


    fun returnProgramRows( programsList: MutableList<ProgramRowItems>):Int {
        var numberOfShows =0
        programsList.forEach {
            it.programID
            numberOfShows++
        }

        return programsList.distinctBy { it.programID }.size
    }

    fun returnChannelRows(channelsList: MutableList<ChannelRowItems>):Int {
        return channelsList.distinctBy { it.channelID }.size
    }
